import React, { useState } from 'react';
import axios from 'axios';
import './Inscription.css';
function Inscription() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [nom, setNom] = useState('');
  const [isDisabled, setIsDisabled] = useState(true);
  const [cardNumber, setCardNumber] = useState('');
  const [cardName, setCardName] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
alert('sd')
    try {
      console.log('Sending login request...');
      const response = await axios.post('http://localhost:8000/user/createUser', {
        email: email,
        password: password,

      }, );

      console.log('Login response:', response);

      if (response.status === 200) {
     
        sessionStorage.setItem('Role',JSON.stringify(response.data.role));
        
        window.location.href = '/Accueil';

      } else {
        setError('Identifiants incorrects. Veuillez réessayer.');
      }
    } catch (error) {
      setError('Une erreur s\'est produite. Veuillez réessayer plus tard.');
      if (error.response) {
        console.error('Error response data:', error.response.data);
        console.error('Error response status:', error.response.status);
        console.error('Error response headers:', error.response.headers);
        setError(error.response.data.error || 'Une erreur s\'est produite. Veuillez réessayer plus tard.');
      } else if (error.request) {
        console.error('Error request:', error.request);
        setError('Aucune réponse du serveur. Veuillez vérifier votre connexion.');
      } else {
        console.error('Error message:', error.message);
        setError('Une erreur s\'est produite. Veuillez réessayer plus tard.');
      }
      console.error('Erreur lors de la connexion :', error);
    }
  };

  return (<>
      <div className="login-container">
        <label className='title'>Inscription</label>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label className='title2' htmlFor="email">Email</label>
            <input
                type="email"
                id="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
            />
          </div>
          <div className="form-group">
            <label className='title2' htmlFor="nom">nom</label>
            <input
                type="texte"
                id="nom"
                value={nom}
                onChange={(e) => setNom(e.target.value)}
                required
            />
          </div>
          <div className="form-group">
            <label className='title2' htmlFor="password">Mot de passe</label>
            <input
                type="password"
                id="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
            />
          </div>
          {error && <div className="error-message">{error}</div>}
        </form> 
            <button  disabled={isDisabled} type="submit">S'inscrire</button>
      </div>



      <div className="card-form">
      <form>
        <div>
          <label>Nom du propriétaire:</label>
          <input
            type="text"
            value={cardName}
            onChange={handleSubmit}
            maxLength="30" // 16 digits + 3 spaces
            placeholder="XXXX XXXX XXXX XXXX"
          />
            <label>Numéro de carte bancaire:</label>
          <input
            type="text"
            value={cardNumber}
            onChange={handleSubmit}
            maxLength="19" // 16 digits + 3 spaces
            placeholder="XXXX XXXX XXXX XXXX"
          />
        </div>
        <button type="submit">Payer</button>
      </form>
      <div className="card-number-display">
        <p>Numéro saisi: {cardNumber}</p>
      </div>
    </div>
      </>
  );
}

export default Inscription;
